import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import {Button} from 'semantic-ui-react';
import Link from 'next/link'


const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,

    },


    title: {
        flexGrow: 1,
    },


}));


function ButtonAppBar() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <AppBar position="static" style={{backgroundColor: '#0174DF'}}>
                <Toolbar>
                    <img src={"http://icons.iconarchive.com/icons/graphicloads/colorful-long-shadow/72/Car-icon.png"}
                         alt="Logo"/>
                    <h1 style={{margin: '0 5px'}}>Car Record</h1>


                </Toolbar>

                <Toolbar style={{float:'right'}}>
                    <Button.Group floated='left'>
                        <Button color={'red'}>One</Button>
                        <Button>Two</Button>
                        <Button>Three</Button>
                    </Button.Group>
                </Toolbar>

            </AppBar>
        </div>
    );
}

export default ButtonAppBar;
